script: |
  super -f text -I q10525.spq | sort > q10525.out

inputs:
  - name: q10525.spq
    data: |
      SELECT DISTINCT + col1 AS col2 FROM tab0 (FORMAT parquet) WHERE + col2 NOT IN ( col0, col1 * + col2 + + col1 + + col2 );
  - name: tab0

outputs:
  - name: q10525.out
    data: |
      1
      21
      81
